import { useEffect, useRef } from "react";
import "./try.css";
import signup from "./Frame.png";

function Try() {
  const containerRef = useRef(null);

  useEffect(() => {
    const el = containerRef.current;
    if (!el) return;

    const onWheel = (e) => {
      e.preventDefault();

      el.scrollBy({
        top: e.deltaY * 0.4, // ðŸ”¥ slow factor (0.3 = very slow, 1 = normal)
        behavior: "smooth",
      });
    };

    el.addEventListener("wheel", onWheel, { passive: false });

    return () => el.removeEventListener("wheel", onWheel);
  }, []);

  return (
    <div className="container" ref={containerRef}>
      <div className="left">
        {[
          ["01", "Your data stays yours"],
          ["02", "Built for safety first"],
          ["03", "Transparent and in your control"],
          ["04", "Clinically reviewed"],
          ["05", "US healthcare compliant"],
          ["06", "Human doctors involved"],
        ].map(([num, title], i) => (
          <div key={i} className={`section r${i + 1}`}>
            <div className="top-row">
              <img src={signup} alt="" />
              <p>{num}</p>
            </div>
            <div className="gradient" />
            <h3>{title}</h3>
            <h6>
              This section exists to demonstrate slow, controlled, premium
              scrolling instead of the browserâ€™s usual caffeine-fueled chaos.
            </h6>
          </div>
        ))}
      </div>

      <div className="right">
        <div className="img img1" />
        <div className="img img2" />
        <div className="img img3" />
        <div className="img img4" />
        <div className="img img5" />
        <div className="img img6" />
      </div>
    </div>
  );
}

export default Try;
